import "../styles/main.css";
import braveImage from "../styles/brave.png";
import { useNavigate } from "react-router-dom";

const Coverr = () => {
  const navigate = useNavigate();
  return (
    <div>
      <div className="container">
        <div className="divA">
          <div className="cover">
            <div className="judul1">The Wedding Of</div>
            <div className="judul2 nama-pasangan">Zaki & Nabila</div>
            <div className="quotes">
              “And I knew exactly how old Walt Disney’s Cinderella felt when she
              found her prince.”
              <br />— Elizabeth Young
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Coverr;
